import React, { useState, useRef } from 'react';
import { useHistory } from 'react-router-dom';

const ProfileSetup = () => {
    const [attributes, setAttributes] = useState({
        height: '',
        weight: '',
        age: '',
        gender: '',
        skin_tone: ''
    });
    const [photo, setPhoto] = useState(null);
    const [capturedImage, setCapturedImage] = useState(null);
    const videoRef = useRef(null);
    const history = useHistory();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setAttributes({
            ...attributes,
            [name]: value
        });
    };

    const handleFileChange = (event) => {
        setPhoto(event.target.files[0]);
    };

    const handleUpload = async () => {
        if (!photo) return;

        const formData = new FormData();
        formData.append('photo', photo);

        try {
            const response = await fetch('/upload-photo/', {
                method: 'POST',
                body: formData,
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('access_token')}`
                }
            });
            const data = await response.json();
            console.log(data);
            if (data.success) {
                // Handle success response, if needed
            }
        } catch (error) {
            console.error('Error uploading photo', error);
        }
    };

    const startCamera = () => {
        navigator.mediaDevices.getUserMedia({ video: true })
            .then(stream => {
                videoRef.current.srcObject = stream;
            })
            .catch(err => console.error("Error accessing camera: ", err));
    };

    const captureImage = () => {
        const canvas = document.createElement('canvas');
        canvas.width = videoRef.current.videoWidth;
        canvas.height = videoRef.current.videoHeight;
        canvas.getContext('2d').drawImage(videoRef.current, 0, 0);
        const imageDataUrl = canvas.toDataURL('image/png');
        setCapturedImage(imageDataUrl);
        sendCapturedImageToServer(imageDataUrl);
    };

    const sendCapturedImageToServer = async (imageDataUrl) => {
        try {
            const response = await fetch('/capture_image/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${localStorage.getItem('access_token')}`
                },
                body: JSON.stringify({ image: imageDataUrl })
            });
            const data = await response.json();
            console.log(data);
            if (data.success) {
                // Handle success response, if needed
            }
        } catch (error) {
            console.error('Error capturing image', error);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const formData = new FormData();
        
        // Append attributes to formData
        formData.append('height', attributes.height);
        formData.append('weight', attributes.weight);
        formData.append('age', attributes.age);
        formData.append('gender', attributes.gender);
        formData.append('skin_tone', attributes.skin_tone);
        
        // Append photo if available
        if (photo) {
            formData.append('photo', photo);
        }
        
        try {
            const response = await fetch('/profile-setup/', {
                method: 'POST',
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('access_token')}`
                },
                body: formData
            });
            const data = await response.json();
            console.log(data);
            if (data.success) {
                history.push('/home'); // Redirect to the profile page or desired path
            }
        } catch (error) {
            console.error('Error submitting profile attributes', error);
        }
    };
    

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <input type="text" name="height" value={attributes.height} onChange={handleChange} placeholder="Height" />
                <input type="text" name="weight" value={attributes.weight} onChange={handleChange} placeholder="Weight" />
                <input type="text" name="age" value={attributes.age} onChange={handleChange} placeholder="Age" />
                <input type="text" name="gender" value={attributes.gender} onChange={handleChange} placeholder="Gender" />
                <input type="text" name="skin_tone" value={attributes.skin_tone} onChange={handleChange} placeholder="Skin Tone" />
                
                {/* Photo upload */}
                <input type="file" onChange={handleFileChange} />
                <button type="button" onClick={handleUpload}>Upload Photo</button>

                {/* Live image capture */}
                <div>
                    <video ref={videoRef} autoPlay />
                    <button type="button" onClick={startCamera}>Start Camera</button>
                    <button type="button" onClick={captureImage}>Capture Image</button>
                    {capturedImage && <img src={capturedImage} alt="Captured" />}
                </div>

                <button type="submit">Submit Profile</button>
            </form>
        </div>
    );
};

export default ProfileSetup;
